import React from 'react';
// import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">

      <h1>Maverick Move</h1>
        <p>Bringing property right to your fingertips</p>
        <textarea>City, State</textarea>
        <button>Search</button>

      </header>
      <body>
        <p>Tell us where you would like to move</p>
      </body>
    </div>
  );
}

export default App;
